import React, { Component } from 'react';
import GetHomeService from '../../services/GetHomeService.js';

class Homes extends Component {

    constructor(props) {

        super(props);
        //   let homes = GetHomeService.getHomes('http://localhost:8080/homes');
        this.state = {
            todos:
                [
                    { id: 1, description: 'Learn to Dance', done: false, targetDate: new Date() },
                    { id: 2, description: 'Become an Expert at React', done: false, targetDate: new Date() },
                    { id: 3, description: 'Visit India', done: false, targetDate: new Date() }
                ],
            homelist: [{}],
            status: -1
        }


    }


    render() {
        // console.log(this.state.homelist)
       // this.setState({ homelist: this.hanldeSuccessCall })
        return (
            <>
                <ShowHomes status={this.state.status}></ShowHomes>
                <div className="container bg-light">
                    <button onClick={this.hanldeSuccessCall}></button>
                </div>
            </>);


    }


    hanldeSuccessCall = () => {

        let homes = GetHomeService.getHomes('http://localhost:8080/homes');
        this.setState({ status: 1 })
        this.setState({ homelist: homes })
      //  return homes;
    }



}


function ShowHomes(status) {

    if (status === 1) {
        return (

            <div className="container bg-light">
                <table className='table table-striped'>
                    <thead className='thead-dark'>
                        <tr>
                            <th>Description</th>
                            <th>Completed</th>
                            <th>Due Date</th></tr>
                    </thead>
                    <tbody>
                        {
                            this.state.homelist.map(
                                home =>
                                    <tr key={home.homeId}>
                                        <td>{home.name}</td>
                                        <td>{home.url.toString()}</td>
                                        <td>{home.phone.toString()}</td>
                                    </tr>
                            )
                        }

                    </tbody>

                </table>
            </div>
        )
    }
    else {
        return null;
    }
}



export default Homes;
